package org.la.student.nizaam.loop.whilee;

public class Q51AllNaturalNum {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		//	51.	Wap to find sum of all natural numbers between 1 to n.
		int i=1;
		
		while(i<=100) {
			
				System.out.print(i+",");
			
			i++;
		}
	}

}
